# redPackage pool



class RedPackagePool:
	def __init__(self, dictt):
		self.pool = []
		for money,amount in dictt.items():
			self.pool.extend([money]*amount)

	def reminding(self):
		return sum(self.pool)

	def pickOne(self):
		if len(self.pool) == 0:
			return -1
		index = randint(0, len(self.pool)-1)
		money = self.pool.pop(index)
		return money



